import React, { useState } from 'react'
import SongList from './Components/SongList'

function App() {
  const [songs, setSongs] = useState([
    { title: 'almost home', id: 1 },
    { title: 'memory gospel', id: 2 },
    { title: 'this wild darkness', id: 3 }
  ]);
  return (
    <>
          <SongList/>
    </>
  )
}

export default App
